import React, { Component } from 'react';
import './Homepage.css';

class Homepage extends Component {
    render() {
        return (
            <div>
                <h2>FUN - SPORT WEBSITE</h2>
                <div className>
                    <a>Sign up</a>
                    <a>Log in</a>
                    <a>Guest</a>
                </div>


            </div>
        );
    }
}

export default Homepage;
